Q|160#90#98#5#5#5000#M$M#rs$AOn4CLC0E0HT0oHLVJUZh9CeusH4dE6BYg\"}},\"microformat\":{\"playerMicroformatRenderer\":{\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/Cijh3bdxwmE\/maxresdefault.jpg\",\"width\":1280,\"height\":720}]},\"embed\":{\"iframeUrl\":\"https:\/\/www.youtube.com\/embed\/Cijh3bdxwmE\",\"flashUrl\":\"http:\/\/www.youtube.com\/v\/Cijh3bdxwmE?version=3\\u0026autohide=1\",\"width\":1280,\"height\":720,\"flashSecureUrl\":\"https:\/\/www.youtube.com\/v\/Cijh3bdxwmE?version=3\\u0026autohide=1\"},\"title\":{\"simpleText\":\"Fox News keeps breaking its own rules\"},\"description\":{\"simpleText\":\"Sean Hannity appeared on stage at a Trump rally before the midterm elections. It's the latest example of Fox News’ transformation from right-wing news network into full-on Republican campaign operation. \\n\\nSubscribe to our channel! http:\/\/goo.gl\/0bsAjO\\n\\nFox News constantly accuses other news organizations of having a liberal bias, claiming networks like CNN and MSNBC are in bed with the Democratic Party. But over the past few years, major Fox personalities ike Sean Hannity, Laura Ingraham, and Jeanine Pirro have become more open about their support for the Republican Party -- appearing at GOP campaign events, speaking at Republican fundraisers, and even explicitly endorsing Republican candidates on air. Republican candidates have noticed, and have begun using friendly coverage on Fox as part of their campaign strategies. \\n\\nFox News is transforming from a right-wing news network into a full-on Republican campaign operation. Pretty soon, people like Sean Hannity won’t have to leave their studio sets to be on the campaign trail. \\n\\nOn Strikethrough, Vox producer Carlos Maza explores the challenges facing the news media in the age of Trump. Follow Carlos on Facebook for more: https:\/\/www.facebook.com\/CarlosMazaVox\\n\\nVox.com is a news website that helps you cut through the noise and understand what's really driving the events in the headlines. Check out http:\/\/www.vox.com.\\n\\nWatch our full video catalog: http:\/\/goo.gl\/IZONyE\\nFollow Vox on Facebook: http:\/\/goo.gl\/U2g06o\\nOr Twitter: http:\/\/goo.gl\/XFrZ5H\"},\"lengthSeconds\":\"483\",\"ownerProfileUrl\":\"http:\/\/www.youtube.com\/user\/voxdotcom\",\"externalChannelId\":\"UCLXo7UDZvByw2ixzpQCufnA\",\"isFamilySafe\":true,\"availableCountries\":[\"AD\",\"AE\",\"AF\",\"AG\",\"AI\",\"AL\",\"AM\",\"AO\",\"AQ\",\"AR\",\"AS\",\"AT\",\"AU\",\"AW\",\"AX\",\"AZ\",\"BA\",\"BB\",\"BD\",\"BE\",\"BF\",\"BG\",\"BH\",\"BI\",\"BJ\",\"BL\",\"BM\",\"BN\",\"BO\",\"BQ\",\"BR\",\"BS\",\"BT\",\"BV\",\"BW\",\"BY\",\"BZ\",\"CA\",\"CC\",\"CD\",\"CF\",\"CG\",\"CH\",\"CI\",\"CK\",\"CL\",\"CM\",\"CN\",\"CO\",\"CR\",\"CU\",\"CV\",\"CW\",\"CX\",\"CY\",\"CZ\",\"DE\",\"DJ\",\"DK\",\"DM\",\"DO\",\"DZ\",\"EC\",\"EE\",\"EG\",\"EH\",\"ER\",\"ES\",\"ET\",\"FI\",\"FJ\",\"FK\",\"FM\",\"FO\",\"FR\",\"GA\",\"GB\",\"GD\",\"GE\",\"GF\",\"GG\",\"GH\",\"GI\",\"GL\",\"GM\",\"GN\",\"GP\",\"GQ\",\"GR\",\"GS\",\"GT\",\"GU\",\"GW\",\"GY\",\"HK\",\"HM\",\"HN\",\"HR\",\"HT\",\"HU\",\"ID\",\"IE\",\"IL\",\"IM\",\"IN\",\"IO\",\"IQ\",\"IR\",\"IS\",\"IT\",\"JE\",\"JM\",\"JO\",\"JP\",\"KE\",\"KG\",\"KH\",\"KI\",\"KM\",\"KN\",\"KP\",\"KR\",\"KW\",\"KY\",\"KZ\",\"LA\",\"LB\",\"LC\",\"LI\",\"LK\",\"LR\",\"LS\",\"LT\",\"LU\",\"LV\",\"LY\",\"MA\",\"MC\",\"MD\",\"ME\",\"MF\",\"MG\",\"MH\",\"MK\",\"ML\",\"MM\",\"MN\",\"MO\",\"MP\",\"MQ\",\"MR\",\"MS\",\"MT\",\"MU\",\"MV\",\"MW\",\"MX\",\"MY\",\"MZ\",\"NA\",\"NC\",\"NE\",\"NF\",\"NG\",\"NI\",\"NL\",\"NO\",\"NP\",\"NR\",\"NU\",\"NZ\",\"OM\",\"PA\",\"PE\",\"PF\",\"PG\",\"PH\",\"PK\",\"PL\",\"PM\",\"PN\",\"PR\",\"PS\",\"PT\",\"PW\",\"PY\",\"QA\",\"RE\",\"RO\",\"RS\",\"RU\",\"RW\",\"SA\",\"SB\",\"SC\",\"SD\",\"SE\",\"SG\",\"SH\",\"SI\",\"SJ\",\"SK\",\"SL\",\"SM\",\"SN\",\"SO\",\"SR\",\"SS\",\"ST\",\"SV\",\"SX\",\"SY\",\"SZ\",\"TC\",\"TD\",\"TF\",\"TG\",\"TH\",\"TJ\",\"TK\",\"TL\",\"TM\",\"TN\",\"TO\",\"TR\",\"TT\",\"TV\",\"TW\",\"TZ\",\"UA\" escription":"Sean Hannity appeared on stage at a Trump rally before the midterm elections. It's the latest example of Fox News’ transformation from right-wing news network into full-on Republican campaign operation. \n\nSubscribe to our channel! http://goo.gl/0bsAjO\n\nFox News constantly accuses other news organizations of having a liberal bias, claiming networks like CNN and MSNBC are in bed with the Democratic Party. But over the past few years, major Fox personalities ike Sean Hannity, Laura Ingraham, and Jeanine Pirro have become more open about their support for the Republican Party -- appearing at GOP campaign events, speaking at Republican fundraisers, and even explicitly endorsing Republican candidates on air. Republican candidates have noticed, and have begun using friendly coverage on Fox as part of their campaign strategies. \n\nFox News is transforming from a right-wing news network into a full-on Republican campaign operation. Pretty soon, people like Sean Hannity won’t have to leave their studio sets to be on the campaign trail. \n\nOn Strikethrough, Vox producer Carlos Maza explores the challenges facing the news media in the age of Trump. Follow Carlos on Facebook for more: https://www.facebook.com/CarlosMazaVox\n\nVox.com is a news website that helps you cut through the noise and understand what's really driving the events in the headlines. Check out http://www.vox.com.\n\nWatch our full video catalog: http://goo.gl/IZONyE\nFollow Vox on Facebook: http://goo.gl/U2g06o\nOr Twitter: http://goo.gl/XFrZ5H","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/Cijh3bdxwmE/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLDXeTbc59zzskZ53j-MtM89ClDZDQ","width":168,"height":94},{"url":"https://i.ytimg.com/vi/Cijh3bdxwmE/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLDjbjx_CF9W-Khi4j9QQJ_gtWUa3w","width":196,"height":110},{"url":"https://i.ytimg.com/vi/Ci e more open about their support for the Republican Party -- appearing at GOP campaign events, speaking at Republican fundraisers, and even explicitly endorsing Republican candidates on air. Republican candidates have noticed, and have begun using friendly coverage on Fox as part of their campaign strategies. \n\nFox News is transforming from a right-wing news network into a full-on Republican campaign operation. Pretty soon, people like Sean Hannity won’t have to leave their studio sets to be on the campaign trail. \n\nOn Strikethrough, Vox producer Carlos Maza explores the challenges facing the news media in the age of Trump. Follow Carlos on Facebook for more: https://www.facebook.com/CarlosMazaVox\n\nVox.com is a news website that helps you cut through the noise and understand what's really driving the events in the headlines. Check out http://www.vox.com.\n\nWatch our full video catalog: http://goo.gl/IZONyE\nFollow Vox on Facebook: http://goo.gl/U2g06o\nOr Twitter: http://goo.gl/XFrZ5H"},"lengthSeconds":"483","ownerProfileUrl":"http://www.youtube.com/user/voxdotcom","externalChannelId":"UCLXo7UDZvByw2ixzpQCufnA","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IO","IQ","IR","IS","IT","JE","JM","JO","JP","KE","KG","KH","KI","KM","KN","KP","KR","KW","KY","KZ","LA","LB","LC","LI","LK","LR","LS","LT","LU","LV","LY","MA","MC","MD","ME","MF","MG","MH","MK","ML","MM","MN","MO","MP","MQ","MR","MS","MT","MU","MV","MW","MX","MY","MZ","NA","NC","NE","NF","NG","NI
